function mathOperations(num1, num2, sign) {
    const operations = {
        '+': (a, b) => a + b,
        '-': (a, b) => a - b,
        '*': (a, b) => a * b,
        '/': (a, b) => a / b,
        '%': (a, b) => a % b,
        '**': (a, b) => a ** b
    };

    const result = operations[sign](num1, num2);
    console.log(result);
}

