function mathOperations(num1, num2, sign) {
    let result = 0;
    if (sign === '+') {
        result = num1 + num2;
    } else if (sign === '-') {
        result = num1 - num2;
    } else if (sign === '*') {
        result = num1 * num2;
    } else if (sign === '/') {
        result = num1 / num2;
    } else if (sign === '%') {
        result = num1 % num2;
    } else if (sign === '**') {
        result = Math.pow(num1, num2);
    }
    console.log(result);
}

